610	\N	\N	2025-12-19 09:50:34.008077	1	https://www.odoo.com/documentation/master/applications/finance/fiscal_localizations/peru.html	{"en_US": ""}	l10n_pe	Vauxoo, Odoo S.A.	/account/static/description/l10n.png	uninstalled	\N	{"en_US": "Peru - Accounting"}	57	{"en_US": "Minimal set of accounts to start to work in Per.\\n=================================================\\n\\nThe usage of this CoA must refer to the official documentation on MEF.\\n\\nhttps://www.mef.gob.pe/contenidos/conta_publ/documentac/VERSION_MODIFICADA_PCG_EMPRESARIAL.pdf\\nhttps://www.mef.gob.pe/contenidos/conta_publ/documentac/PCGE_2019.pdf\\n\\nAll the legal references can be found here.\\n\\nhttp://www.sunat.gob.pe/legislacion/general/index.html\\n\\nConsiderations.\\n===============\\n\\nChart of account:\\n-----------------\\n\\nThe tree of the CoA is done using account groups, the most common accounts \\nare available within their group, if you want to create a new account use \\nthe groups as reference. \\n\\nTaxes:\\n------\\n\\n'IGV': {'name': 'VAT', 'code': 'S'},\\n'IVAP': {'name': 'VAT', 'code': ''},\\n'ISC': {'name': 'EXC', 'code': 'S'},\\n'ICBPER': {'name': 'OTH', 'code': ''},\\n'EXP': {'name': 'FRE', 'code': 'G'},\\n'GRA': {'name': 'FRE', 'code': 'Z'},\\n'EXO': {'name': 'VAT', 'code': 'E'},\\n'INA': {'name': 'FRE', 'code': 'O'},\\n'OTHERS': {'name': 'OTH', 'code': 'S'},\\n\\nWe added on this module the 3 concepts in taxes (necessary for the EDI\\nsignature)\\n\\nEDI Peruvian Code: used to select the type of tax from the SUNAT\\nEDI UNECE code: used to select the type of tax based on the United Nations\\nEconomic Commission\\nEDI Affect. Reason: type of affectation to the IGV based on the Catalog 07\\n\\nProducts:\\n---------\\n\\nCode for products to be used in the EDI are availables here, in order to decide\\nwhich tax use due to which code following this reference and python code:\\n\\nhttps://docs.google.com/spreadsheets/d/1f1fxV8uGhA-Qz9-R1L1-dJirZ8xi3Wfg/edit#gid=662652969\\n\\n**Nota:**\\n---------\\n\\n**RELACIN ENTRE EL PCGE Y LA LEGISLACIN TRIBUTARIA:**\\n\\nEste PCGE ha sido preparado como una herramienta de carcter contable, para acumular informacin que\\nrequiere ser expuesta en el cuerpo de los estados financieros o en las notas a dichos estados. Esa acumulacin se\\nefecta en los libros o registros contables, cuya denominacin y naturaleza depende de las actividades que se\\nefecten, y que permiten acciones de verificacin, control y seguimiento. Las NIIF completas y la NIIF PYMES no\\ncontienen prescripciones sobre tenedura de libros, y consecuentemente, sobre los libros y otros registros\\nde naturaleza contable. Por otro lado, si bien es cierto la contabilidad es tambin un insumo, dentro de otros, para\\nlabores de cumplimiento tributario, este PCGE no ha sido elaborado para satisfacer prescripciones tributarias ni su\\nverificacin. No obstante ello, donde no hubo oposicin entre la contabilidad financiera prescrita por las NIIF y\\nla legislacin tributaria, este PCGE ha incluido subcuentas, divisionarias y sub divisionarias, para\\ndistinguir componentes con validez tributaria, dentro del conjunto de componentes que corresponden a una\\nperspectiva contable ntegramente. Por lo tanto, este PCGE no debe ser considerado en ningn aspecto\\ncomo una gua con propsitos distintos del contable.\\n"}	f	f	f	LGPL-3	100	t	f	\N	\N	\N	\N				official	\N
